import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import App from "./App"
import { BrowserRouter } from "react-router-dom"
import {AuthContext} from "./contexts/"

//bootstrap por favor
ReactDOM.render(
  <BrowserRouter>
    <AuthContext>
      <App />
    </AuthContext>
  </BrowserRouter>,
  document.getElementById("root")
);
